import React from 'react';
import './Cards.css';

function Cards4() {
  return (
    <div className='cards'>
      <h2>Invoice</h2>
      <div className='cards__container'>
        <div className='cards__wrapper'>
          <ul className='cards__items'>
              <p>...............................</p>
              <p>...............................</p>
              <p>...............................</p>
              <p>...............................</p>
          </ul>
        </div>
      </div>
    </div>
  );
}

export default Cards4;
